"place": -1,
"text": "<div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nAccording to his grandson, Greg Smith, \"My grandfather, Reginald windus Fromm , was a boy sailor as you know and his ship was either the prince Rupert or prince Eugene , these we're monitor class and patrolled the Belgian coast. He was a gunner and with no ear protection returned from the war with shell shock. My nan said he never returned straight away and she found him in a naval hospital in Liverpool in something like 1926 . He was never with it after that and I never had serous conversation with him. He suffered from fits almost until the day he died. His leg was amputated above the knee a couple of years before he died and he passed away on the operating table as they were attempting to amputate the other.\"\n</p>\n</div>\n</div>",
"type": "_MILI"
