"place": 342,
"text": "<div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nSubject: SAMUEL FROMM\n</p>\n<p>\nSamuel was admitted as a Liveryman of the Company in 1877. Our records are sparse and far from complete. He was still on the list in 1885 but we have no records from then until 1924 when, not surprisingly, his name is no longer there. Similarly there is no extant record of him being a Freeman, the normal step towards full Livery but there are no records between 1855 and 1870. I am sorry not to be of more help.\n</p>\n<p>\nDavid Eking<br />\nActing Clerk<br />\nWorshipful Company of<br />\nGlaziers &amp; Painters of Glass<br />\nGlaziers Hall<br />\n9 Montague Close<br />\nLondon SE1 9DD\n</p>\n<p>\nTel/Fax 020 7403 6652\n</p>\n</div>\n</div>",
