"text": "<div>\n<i class=\"NoteType\">\nEvent Reference Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nI, James Mclaren assistant registrar of the district of Blackfriars in the burgh of Glasgow, herby certify that on the 10th day of October 1898, Catherine Elspeth Gardiner spinster 21 Schipka Pass Glasgow duly gave notice to me of her intended marriage to William Irvine bachelor joiner 100 Cornwall Street Plantation Govan that all the requirements of law in respect of such notice, fo far as the said Catherine Elspeth Gardiner is concerted have been complied with and no Objections stated.\n</p>\n<p>\nCertified by me James Mclaren this 19th day of October 1892\n</p>\n</div>\n</div>",
