"text": "<div>\n<i class=\"NoteType\">\nGeneral\n</i>\n<div class=\"grampsstylednote\">\n<p>\nLethbridge Herald 2 Oct 1915\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nOver 100 Apply-to Join New Lethbridge Battery on First Recruiting Day\n</p>\n<p>\n&nbsp;\n</p>\n<p>\n&nbsp;\n</p>\n<p>\nRecruiting for the new 39th Battery which opened on Monday morning, has established a new record here, starting off with a rush, and with men lined up for half a block waiting their turn before the doctor.\n</p>\n<p>\nYesterday 56 men were sworn on, and 14 more had passed the medical examination, but had not been sworn,\n</p>\n<p>\nOver 30 more are waiting their turn to be accepted.\n</p>\n<p>\nFrom present indications it will be jut a day or two more before the entire battery of 140 men will be signed<br />\nup and ready for training\n</p>\n<p>\nLieut. Stafford and Lieut. Fumer and the recruiting officers, and they were kept busy from early morning till late at night.\n</p>\n<p>\nDudley Cocq, son of W. A. R. Cocq, was the first man to be sworn on the strength of-the new battery He was<br />\ncongratulated by Lieut. Stafford the next was Charlie McMillin. These two are both Lethbridge boys, but have been working in outside banks for the past year or so.\n</p>\n<p>\nAmong others well-known are William Stevens, city clerk J S Wright, formerly of the Y.M.C.A.<br />\nClarence Sherock formerly of the Herald Sam Ervine formerly of Taber<br />\nR. Fairbrother of the Taylor mills<br />\nFred Downer ? Raised in Lethbridge<br />\nHarold Hamilton son of W.A. Hamilton ? Raised in Lethbridge<br />\nVernon Redmond ? Raised in Lethbridge.<br />\nClarence Sherlock is Lethbridge born\n</p>\n<p>\nThe following are those who were sworn in.<br />\nF Steedman ? English<br />\nThomas McIndoe grain buyer Scotch<br />\nJohn H. Harold Hamilton Student Canadian Vernon<br />\nA. Redmond postal clerk Canadian<br />\nAfred W. Smith clerk English<br />\nSidney E. Collier teamster English<br />\nJohn McNeil teamster English<br />\nG. R. Norman Sandbach bank clerk Irish<br />\nFred Kane mechanic Irish<br />\nJoseph Thomas Wellington painter English<br />\nRobert A Fairbrother Bookkeeper Scotch<br />\nRobert J. Chiswick Accountant English<br />\nS. Truman Janitor<br />\nF.W.R. Downer Clerk Canadian<br />\nFrederick Charles Williams clerk Canadian<br />\nJohn Howard McGinniss Woodworker Scotch<br />\nJohn Leslie O?Brien Snell bank clerk English<br />\nTemplar Robert Kerr Sign writer Canadian<br />\nErnest James Hooker clerk English<br />\nGeorge Masson Letter carrier Scotch<br />\nJohn Ernest Sydal Book-keeper English<br />\nWilliam Crombie Marnoch Builder ? Scotch<br />\nCharles Ernest Sydal Book-keeper English<br />\nWilliam Crombie Marnoch Builder Scotch<br />\nAlfred William Whitebread Porter English<br />\nJames Kaines Civil engineer English<br />\nNeil McVicar Letter carrier scotch<br />\nJohn Rollo Wheelwright Scotch<br />\nHenry Baldry Letter Carrier English<br />\nRobert Ernest Baldry Letter Carrier English<br />\nMorris Horton Irvine Guard English<br />\nArthur Seager Teamster English<br />\nFred Steven Clerk Scotch<br />\nAlex Lothian Letter Carrier Scotch<br />\nWalter Fyfe Miner Scotch<br />\nReginald Matthews Letter Carrier English<br />\nC. Bacon English<br />\nHoward James Holloway Farmer English<br />\nSeptimus Logan Miner English<br />\nAlbert William Cox Teamster English<br />\nFrank McGillan? Farmer English<br />\nRobert Johnes Tinsmith English<br />\nRobert Lothian Miner Scotch<br />\nAdam Robinson Miner English<br />\nSetimms Logan Miner English<br />\nOscar Willette Gardener English<br />\nNorman Atherion? Clerk English<br />\nJohn Spinney Lombard Bank Clerk English<br />\nD.A.R. Cocq Bank Clerk English<br />\nC. Hyndman McMillan Accountant Canadian<br />\nHenry N. Bennett Bank Clerk English\n</p>\n<p>\nThe following recruits have passed the medical examinations successfully and have only to be sworn in, which will be sometime today.\n</p>\n<p>\nFrank C. Werley Scotch<br />\nRobert Lindsay English<br />\nWilliam James Blison Canadian<br />\nClarence E. Sherlock Canadian<br />\nJohn Bushby Barkley Carpenter<br />\nCharles Sellens English<br />\nA.D. Thomas Shipman<br />\nJames George Huggett English<br />\nSamuel Ervine<br />\nWilliam Scott Scotch<br />\nL. Close Scotch<br />\nF.J. Copman English<br />\nGordon Kennedy Watt Scotch\n</p>\n</div>\n<p>\n<b>Age</b>: 37\n</p>\n</div>",
"type": "_MILI"
