"text": "<div>\n<i class=\"NoteType\">\nEvent Reference Note\n</i>\n<div class=\"grampsstylednote\">\n<p>\nI, James Reid Brownlie Registrar of the District of Plantation in the county of Lanark hereby certify that on the 10th day of October 1898, William Irvine, Bachelor, Joiner, 100 Cornwall Street, Govan duly gave notice to me of his intended marriage to Catherine Elspeth Gardiner, Spinster, 21 Schipka Pass, off London Street Glasgow, District of Blackfriars, Co Lanark, that all requires of law in respect to such notice, so far as the said William Irvine is concerned have been complied with and no Objections Stated.\n</p>\n<p>\nCertified by me James Reid Brownlie this 18th day of October 1898\n</p>\n</div>\n</div>",
